    return(
        <GraySection>
            <SectionHeaderContainer>
            <SectionTitle>
                {title}
            </SectionTitle>
            <CenteredText>{subTitle}</CenteredText>
            </SectionHeaderContainer>
            <ArticleSlider />
        </GraySection>
    );
}

export default LastestArticles;
